import React from "react";
import PdfViewer from "./pdf-viewer";

function MasterworkWeapons(){
    const PdfUrl="https://homebrewery.naturalcrit.com/share/1N__TC6V3skYltjsFX-CRcP9AVjbFWZbRFoZcHJJI-wMh";

    return(
        <PdfViewer pdfUrl={PdfUrl}></PdfViewer>
    )
}

export default MasterworkWeapons;
